import { assertEquals } from "https://deno.land/std/testing/asserts.ts";

import { ld as _ } from 'https://x.nest.land/deno-lodash@1.0.0/mod.ts';


function originalDigits(s: string): string {
    const res: string[] = [];

    const tbl = [
        "zero",
        "one",
        "two",
        "three",
        "four",
        "five",
        "six",
        "seven",
        "eight",
        "nine",
    ]

    const hash = (w: string) => {
        const h = Array(26).fill(0);
        for (const c of w) {
            const ci = c.charCodeAt(0) - "a".charCodeAt(0);
            h[ci]++
        }
        return h
    }

    // build hash
    const dic = tbl.map(w => hash(w));

    let input = hash(s);

    // console.log({ dic, input })

    let found = true;
    while (found) {
        found = false;
        for (const n of [2, 4, 5, 6, 8, 3, 0, 1, 7, 9]) {
            const zip = _.zip(input, dic[n])
            if (zip.every((x: number[]) => x[0] >= x[1])) {
                input = zip.map((x: number[]) => x[0] - x[1]);
                res.push(String(n));
                found = true;
                break;
            }
        }
    }

    return res.sort().join("")
}

Deno.test("test", () => {
    assertEquals(originalDigits("owoztneoer"), "012");
})
Deno.test("test", () => {
    assertEquals(originalDigits("fviefuro"), "45");
})
Deno.test("test", () => {
    const input = ""
    const output = ""
    assertEquals(originalDigits(input), output);
})
